import echarts from 'echarts'
import Core from '../../core'
const rankingIcon = (source, settings, extra) => {
  // 对数据进行排序
  // 从小到大排列
  source = source.sort((a, b) => {
    return a.value * 1 - b.value * 1
  })
  let data = [], keys = []
  source.forEach(item => {
    data.push(item.value)
    keys.push(item.name)
  })
  // 获取最大值
  let maxD = Math.max.apply(null, data)
  let maxData = [...Array(source.length).keys()].map(item => {
    return maxD
  })
  let option = {
    grid: {
      left: '60px',
      right: '40px',
      top: '30px',
      bottom: '30px'
    },
    xAxis: {
      type: 'value',
      show: false
    },
    yAxis: {
      type: 'category',
      axisLine: { show: false },
      axisTick: { show: false },
      axisLabel: {
        show: true,
        margin: 15,
        formatter: (value,index) => {
          let str='{lg|' + (data.length - index) + '}'
          switch (data.length - index) {
              case 1:
                  str= '{one|1}'
                  break
              case 2:
                  str= '{two|2}'
                  break
              case 3:
                  str= '{three|3}'
                  break
          }
           return str
        },
        rich: {
          'one': {
              color: '#ED5E7B',
              borderColor: '#ED5E7B',
              fontSize: 18,
              fontWeight: 700,
              height: 35,
              width: 35,
            align: 'center',
            backgroundColor: {
              image: 'data:image/png;base64,'
            }
          },
          'two': {
              color: '#F3BE33',
              borderColor: '#F3BE33',
              fontSize: 18,
              fontWeight: 700,
              height: 35,
              width: 35,
            align: 'center',
            backgroundColor: {
              image: 'data:image/png;base64,'
            }
          },
          'three': {
              color: '#78D971',
              borderColor: '#78D971',
              fontSize: 18,
              fontWeight: 700,
              height: 35,
              width: 35,
            align: 'center',
            backgroundColor: {
              image: 'data:image/png;base64,'
            }
          },
          lg: {
            color: '#1296DB',
            borderColor: '#1296DB',
            fontSize: 18,
            fontWeight: 700,
            height: 35,
            width: 35,
            align: 'center',
            backgroundColor: {
               image: 'data:image/png;base64,'
            }
          }
        }
      },
      data: keys
    },
    series: [
      {
        type: 'bar',
        label: {
          normal: {
            show: true,
            position: 'insideRight',
            distance: 0,
            offset: [0, -15],
            color: '#fff',
            fontSize: 16,
            padding: [5, 10, 5, 10],
            formatter: '{b}:{c}',
            backgroundColor: {
              image: 'data:image/png;base64,'
            }
          }
        },
        barWidth: 16,
        itemStyle: {
          normal: {
            color: new echarts.graphic.LinearGradient(0, 0, 1, 0, [{
              offset: 0,
              color: '#6390F0'

            }, {
              offset: 1,
              color: '#25EBE9'

            }]),
            barBorderRadius: 10
          }
        },
        data: data
      },
      {
        type: 'bar',
        barWidth: 16,
        xAxisIndex: 0,
        barGap: '-100%',
        data: maxData,
        itemStyle: {
          normal: {
            color: '#C9CBCE',
            barBorderRadius: 14
          }
        },
        zlevel: -1
      }
    ]
  }
  return option
}
export default {
  name: 'YiRankingIcon',
  mixins: [Core],
  data () {
    this.chartHandler = rankingIcon
    return {}
  }
}
